Server: {your_server}.database.windows.net,1433 
SQL Database: {your_database}
User Name: {your_user_name}

PHP Data Objects(PDO) Sample Code:

try {
 $conn = new PDO ( "sqlsrv:server = tcp:{your_server}.database.windows.net,1433; Database = {your_database}", "{your_user_name}", "{your_password_here}");
 $conn->setAttribute( PDO::ATTR_ERRMODE, PDO::ERRMODE_EXCEPTION );
}
catch ( PDOException $e ) {
 print( "Error connecting to SQL Server." );
 die(print_r($e));
}
SQL Server Extension Sample Code:

$connectionInfo = array("UID" => "{your_user_name}", "pwd" => "{your_password_here}", "Database" => "{your_database}", "LoginTimeout" => 30, "Encrypt" => 1, "TrustServerCertificate" => 0);
$serverName = "tcp:{your_server}.database.windows.net,1433";
$conn = sqlsrv_connect($serverName, $connectionInfo);
